import React from 'react';
import '../styles/reset.css';
import '../styles/footer.css';

const Footer = () => {
  return (
    <section className="footer">
    <div>
      <p>
        Copyright 2023. By Rendi Virgantara Setiawan
      </p>
    </div>
    </section>
  );
}

export default Footer;
